import React from 'react';
import styled from 'styled-components';

const imgBox = styled.div`
    display: relative;

    width: 70px;
    height: 70px;
    border: 1px solid black;
`;

const Listitem = () => {
    return (
        <imgBox src={require("../kkobookchip.jpeg")}/>
    );
};

export default Listitem;
